import React, { useEffect, useState } from 'react';
import { Table, TableHead, TableBody, TableRow, TableCell, Container, Typography, Box } from '@mui/material';
import api from '../services/api';
import Sidebar from './Sidebar';

export default function PaymentList() {
  const [payments, setPayments] = useState([]);

  useEffect(() => {
    api.get('/payments').then(res => setPayments(res.data));
  }, []);

  return (
    <Box sx={{ display: 'flex' }}>
      <Sidebar />
      <Container sx={{ mt: 4 }}>
        <Typography variant="h5" gutterBottom>Payments</Typography>
        <Table size="small">
          <TableHead>
            <TableRow>
              <TableCell>Order ID</TableCell>
              <TableCell>Customer</TableCell>
              <TableCell>Amount</TableCell>
              <TableCell>Method</TableCell>
              <TableCell>Date</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {payments.map(p => (
              <TableRow key={p.id}>
                <TableCell>{p.order_id}</TableCell>
                <TableCell>{p.customer_name}</TableCell>
                <TableCell>{p.amount} FCFA</TableCell>
                <TableCell>{p.method}</TableCell>
                <TableCell>{p.date}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </Container>
    </Box>
  );
}
